webpackJsonp([65513615697405],{1047:function(e,s){e.exports={data:{package:{id:"bs-humps",score:.5642848439351414,name:"bs-humps",version:"0.0.1",description:"humps bindings in Reason",keywords:[],license:"MIT",updated:"2018-01-08T14:11:35.917Z",stars:0,type:"published",quality:.7020894029935822,popularity:.019554543396009205,maintenance:.9908969509956103,readme:'<h1>bs-humps</h1>\n<p>humps bindings for <a href="https://github.com/bloomberg/bucklescript">BuckleScript</a> in <a href="https://github.com/facebook/reason">Reason</a>.</p>\n<h1>Installation</h1>\n<ol>\n<li>install bs-humps</li>\n</ol>\n<pre><code class="language-sh">$ yarn add bs-humps\n\n# or\n$ npm install --save bs-humps\n</code></pre>\n<ol start="2">\n<li>Add \'bs-humps\' to \'bs-dependencies\' section of <code>bsconfig.json</code> .</li>\n</ol>\n<h1>Usage</h1>\n<p>Converting strings</p>\n<pre><code class="language-ml">Humps.camelize "hello_world"\n(* => helloWorld *)\n\nHumps.decamelize "fooBar"\n(* => foo_bar *)\n\nHumps.decamelizeWithOptions "hooBarBaz" @@ Humps.makeOptions separator::"-" ()\n(* => foo-bar-baz *)\n</code></pre>\n<h1>Development</h1>\n<p>Build this project.</p>\n<pre><code>$ yarn build\n</code></pre>\n<p>Build this project with incremental build.</p>\n<pre><code>$ yarn watch\n</code></pre>\n<p>Run test.</p>\n<pre><code>$ yarn test\n</code></pre>\n<h1>Todo</h1>\n<ul>\n<li class="task-list-item"><input type="checkbox" disabled> Implement external function definitions for <code>**Keys(object, options)</code> API.</li>\n</ul>\n',homepageUrl:"https://github.com/yamadayuki/bs-humps#readme",repositoryUrl:"https://github.com/yamadayuki/bs-humps",npmUrl:"https://www.npmjs.com/package/bs-humps",issuesUrl:"https://github.com/yamadayuki/bs-humps/issues",slug:"packages/bs-humps"}},pathContext:{id:"bs-humps"}}}});
